def set_dimension_themes(array, search_params, dict_list):
    search_params_json = search_params[2]
    if search_params_json == '-#$%-' or search_params_json == '':
        return    
    # Convertir la cadena JSON a una lista de Python
    search_params_list = json.loads(search_params_json)
    for search_param in search_params_list:
        for dictionary in dict_list:
            if dictionary['key'] == search_param:
                index = dictionary['index']
               
                if 0 <= index < len(array):
                    array[index] = True
                


#function to get all the ids from the tutors

def get_tutors_ids():
    cur = con.cursor()
    cur.execute("SELECT DISTINCT respuesta FROM mdl_talentospilos_df_respuestas mtdr WHERE id_pregunta = 61 AND respuesta != ''")
    rows = cur.fetchall()
    cur.close()
    formatted_rows = [respuesta[0] for respuesta in rows]
    
    return formatted_rows

def get_students_ids():
    cur = con.cursor()
    cur.execute("SELECT DISTINCT respuesta FROM mdl_talentospilos_df_respuestas mtdr WHERE id_pregunta = 25 AND respuesta != ''")
    rows = cur.fetchall()
    cur.close()
    formatted_rows = [respuesta[0] for respuesta in rows]
    
    return formatted_rows

