def get_students_info():
    student_ids = get_students_ids()
    
    # Convert list of IDs to a comma-separated string for the SQL query
    student_ids_str = ','.join([str(student_id) for student_id in student_ids])
    
    cur = con.cursor()
    query = f"""
    SELECT substring(mu.username,0,8) as username, firstname, lastname, email
    FROM mdl_user mu
    WHERE id IN ({student_ids_str})
    """
    cur.execute(query)
    rows = cur.fetchall()
    cur.close()
    return rows

