def get_old_tutors_ids():
    cur = con.cursor()
    cur.execute('select id, substring(username,0,8) from mdl_user')
    rows = cur.fetchall()
    cur.close()
    formatted_rows = [(str(respuesta[0]), respuesta[1]) for respuesta in rows]
    
    return formatted_rows



def save_tutors_info_to_excel():
    tutors_info = get_tutors_info()
    
    # Convert to DataFrame
    df = pd.DataFrame(tutors_info, columns=['Username', 'Firstname', 'Lastname', 'Email'])
    
    # Export to Excel
    df.to_csv('tutors_info.csv', index=False)
    print("Data has been written to tutors_info.xlsx")

def create_student_id_mapping(student_ids):
    """
    Creates a mapping between old student IDs and new student IDs based on cod_univalle.
    
    Args:
        student_ids (list): List of student IDs from follow-ups that need to be mapped
        
    Returns:
        dict: Dictionary mapping old IDs to new IDs
    """
    # Get cod_univalle for these students from old database
    old_ids_str = ','.join([str(id) for id in student_ids])
    cur = con.cursor()
    cur.execute(f"""
        SELECT id, cod_univalle 
        FROM students_data 
        WHERE id IN ({old_ids_str})
    """)
    old_student_data = {row[0]: row[1] for row in cur.fetchall()}
    
    # Get matching students from new database
    cod_univalle_list = list(old_student_data.values())
    cod_univalle_str = ','.join([f"'{cod}'" for cod in cod_univalle_list])
    
    cur_ases = ases_con.cursor()
    cur_ases.execute(f"""
        SELECT id, cod_univalle 
        FROM estudiante 
        WHERE cod_univalle IN ({cod_univalle_str})
    """)
    new_student_data = {row[1]: row[0] for row in cur_ases.fetchall()}
    
    # Create the mapping
    id_mapping = {}
    for old_id, cod_univalle in old_student_data.items():
        if cod_univalle in new_student_data:
            id_mapping[old_id] = new_student_data[cod_univalle]
    
    cur.close()
    cur_ases.close()
    
    return id_mapping

