def get_student_data(studentId):
    cur = con.cursor()
    cur.execute(f"select mtu.id, mu.firstname as nombre, mu.lastname as apellido, SUBSTRING(mu.username FROM 1 FOR 7) as cod_univalle, mtpu.cod_univalle as programa, mtu.tipo_doc, mtu.num_doc, mtu.emailpilos as email_ases, mu.email as email_moodle, mtu.sexo, mtu.id_cond_excepcion as id_cond_excepcion_id from mdl_user mu inner join mdl_talentospilos_user_extended mtue on mu.id = mtue.id_moodle_user inner join mdl_talentospilos_usuario mtu on mtue.id_ases_user = mtu.id  inner join mdl_talentospilos_programa mtpu on mtue.id_academic_program = mtpu.id  where mtu.id = {studentId}")
    rows = cur.fetchall()
    cur.close()
    return rows

