from datetime import datetime

def get_all_follow_ups_based_on_year(year, semester):
    limit = 50
    total_tutors = len(get_tutors_ids())
    steps = total_tutors // limit
    for i in range(steps + 1):
        start = i * limit
        end = start + limit - 1
        store_follow_ups_based_on_year(year, semester,limit, start, f"follow_up_data_{year}{semester}_{start}_{end}.csv")

def store_follow_ups_based_on_year(year, semester, limit, offset, file_path):
    tutor_ids = get_tutors_ids()
    paginated_tutor_ids = tutor_ids[offset:offset + limit]
    all_follow_up_data = []

    start_date = datetime(year, 1, 1) if semester == 'A' else datetime(year, 7, 1)
    end_date = datetime(year, 6, 30) if semester == 'A' else datetime(year, 12, 31)

    for tutor_id in paginated_tutor_ids:
        follow_up_ids = get_tutor_follow_ups(tutor_id)
        for follow_up_id in follow_up_ids:
            follow_up_data = get_follow_up_data(follow_up_id)
            date_entry = next((entry for entry in follow_up_data if entry[0] == 1), None)
            if date_entry:
                try:
                    follow_up_date = datetime.strptime(date_entry[2], '%Y-%m-%d')
                    
                    if start_date <= follow_up_date <= end_date:    
                        print(follow_up_date)
                        all_follow_up_data.append(follow_up_data)
                except ValueError:
                    print('Bad date')
                    continue
    translate_follow_up(all_follow_up_data, file_path)
    print(f'Stored {len(all_follow_up_data)} follow-ups from the {semester} semester of {year} to {file_path}')

def store_follow_ups_first_semester(year, limit, offset, file_path):
    tutor_ids = get_tutors_ids()
    paginated_tutor_ids = tutor_ids[offset:offset + limit]
    all_follow_up_data = []

    start_date = datetime(year, 1, 1)
    end_date = datetime(year, 6, 30)

    for tutor_id in paginated_tutor_ids:
        follow_up_ids = get_tutor_follow_ups(tutor_id)
        for follow_up_id in follow_up_ids:
            follow_up_data = get_follow_up_data(follow_up_id)
            date_entry = next((entry for entry in follow_up_data if entry[0] == 1), None)
            if date_entry:
                try:
                    follow_up_date = datetime.strptime(date_entry[2], '%Y-%m-%d')
                    if start_date <= follow_up_date <= end_date:
                        all_follow_up_data.append(follow_up_data)
                except ValueError:
                    continue
    
    translate_follow_up(all_follow_up_data, file_path)
    print(f'Stored {len(all_follow_up_data)} follow-ups from the first semester of {year} to {file_path}')

def store_student_follow_ups(student_id):
    file_path = f"follow_up_data_student_{student_id}.csv"
    # Get the follow-up IDs for the student
    follow_up_dates = get_student_follow_ups_dates(student_id)
    
    # Extract only the follow-up IDs (first element of each tuple)
    follow_up_ids = [follow_up[0] for follow_up in follow_up_dates]

    # Initialize an empty list to collect all follow-up data
    all_follow_up_data = []

    # For each follow-up ID, retrieve the data and append to the list
    for follow_up_id in follow_up_ids:
        follow_up_data = get_follow_up_data(follow_up_id)
        all_follow_up_data.append(follow_up_data)
    
    # Store all follow-up data in the CSV using the translate_follow_up function
    translate_follow_up(all_follow_up_data, file_path)

    print(f'Stored {len(all_follow_up_data)} follow-ups for student {student_id} to {file_path}')


